- input: "TEXT\x1CC00143743\x1C1\x1C\x1CF3XN\x1CSchedule B, line 21b reports reimbursements
    for travel expenses which are not itemized because they do not exceed the 200
    dollar itemization level and do not exceed the 200 dollar aggregate per vendor
    amount. With respect to the expenditures made by the Party for payroll, payroll
    taxes, and other payroll or employee benefit-related expenses, the Party adheres
    to 11 CFR 300.33, and also follows the Commissions revision of the rules as adopted
    on December 1, 2005. Specifically, the Party pays for these costs with 100 percent
    federal funds when the employee spends more than 25 percent of his or her time
    in a month on federal election activity FEA or activity in connection with a federal
    election. These expenditures are reported on Schedule B for Line 30b. Alternatively,
    when an employee does not meet the 25 percent threshold, the Party allocates these
    costs as an overhead/administrative expense, and reports these disbursements on
    Schedule H4 or Line 21a.  Transfers from federal to non-federal accounts were
    made for cash flow purposes. These funds do not represent a reimbursement of funds
    to the non-federal account for disbursements made to influence the election or
    defeat of federal candidates.  Schedule H4 reports a voided check in the amount
    of $112.40 to Office Depot to void an outstanding check.  The disbursement was
    originally reported on the August Monthly 2010 Report.  This disbursement is a
    overpayment to Office Depot.  The Party did not transfer non-federal funds to
    the federal account for this allocated expenditure, therefore, no transfer back
    to the non-federal account is required.  \n"
